import React, { useState } from "react";
import {
  Problems,
  ProblemBg,
  ProblemImg,
  ProblemTitle,
} from "./ProblemElements";
import img from "../../images/failure.jpg";
import img2 from "../../images/failure2.jpg";

function Problem() {
  const [size, setSize] = useState(24);

  return (
    <>
      <Problems id="problem">
        <ProblemTitle size>Ne, vazduh nije zagadjen.</ProblemTitle>
        <ProblemBg>
          <ProblemImg src={img2} />
        </ProblemBg>
      </Problems>
    </>
  );
}

export default Problem;
